;; gorilla-repl.fileformat = 1

;; **
;;; # Find shapes with hough circles
;;; 
;;; This tutorial shows how to find shape with a given color within an image.
;; **

;; @@
(ns combative-atoll
  (:require
   [opencv3.core :refer :all]
   [opencv3.colors.rgb :as rgb]
   [opencv3.utils :as u]))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; @@
(def bgr-image
  (-> "resources/detect/circles.jpg" imread (u/resize-by 0.5) ))
(u/mat-view bgr-image)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"256\" height=\"256\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x18d4603b \"BufferedImage@18d4603b: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@1a40145 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 256 height = 256 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; @@
(def ogr-image
  (-> bgr-image
   (clone)
   (median-blur! 3)
   (cvt-color! COLOR_BGR2HSV)
   (in-range! (new-scalar 0 100 100) (new-scalar 10 255 255))
   (gaussian-blur! (new-size 9 9) 2 2)))
(u/mat-view ogr-image)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"256\" height=\"256\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x951a664 \"BufferedImage@951a664: type = 10 ColorModel: #pixelBits = 8 numComponents = 1 color space = java.awt.color.ICC_ColorSpace@55fc79e5 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 256 height = 256 #numDataElements 1 dataOff[0] = 0\"]"}
;; <=

;; **
;;; Let's find the circles using the **hough-circles** function from opencv core.
;; **

;; @@
(def circles (new-mat))
(hough-circles ogr-image circles CV_HOUGH_GRADIENT 1 (/ (.rows bgr-image) 8) 100 20 0 0)
(dotimes [i (.cols circles)]
  (let [ _circle (.get circles 0 i) 
         x (nth _circle 0) 
         y (nth _circle 1) 
         r (nth _circle 2)  
         p (new-point x y)]
  (circle bgr-image p (int r) rgb/greenyellow 5)))

(u/mat-view bgr-image)
